  switch (control) {
    case "input":
      return <Input {...rest} />;
    case "textarea":
      return <TextArea {...rest} />;
    case "video":
      return (
        <Video
          type="file"
          {...rest}
          onChange={(e) => {
            console.log(rest);
          }}
        />
      );
    default:
      return null;
  }
};

